import axios from "axios";

const API_URL = '/api/blogs'


// Get blogs
const getBlogs = async() => {
    const response = await axios.get(API_URL)

    console.log(response.data)
    return response.data
}

const blogService = {
    getBlogs
}

export default blogService;
